import React from "react";
import particlesjs from "particlesjs";


class Particles extends React.Component {
  componentDidMount() {
    particlesjs.init({
        selector: 'particles'
    });
  }

  render() {
    return <canvas className="particles"></canvas>;
  }
}

export default Particles;
